import React from 'react';
import DashboardIcon from "@material-ui/icons/Dashboard";
import AccountBalanceWalletIcon from "@material-ui/icons/AccountBalance"
import PaymentIcon from '@material-ui/icons/Payment';
import MonetizationOnIcon from '@material-ui/icons/MonetizationOn';


export const SidebarData = [
  {
    title: 'Overview',
    path: '/dashboard',
    icon: <DashboardIcon/>,
    tool: 'Test tool tip',
    // cName: 'nav-text'
  },
  {
    title: 'Accounts',
    path: '/accounts',
    icon: <AccountBalanceWalletIcon/>,
    tool: 'Test tool tip',
    // cName: 'nav-text'
  },
  {
    title: 'Payments',
    path: '/payables',
    icon: <PaymentIcon/>,
    tool: 'Test tool tip',
    // cName: 'nav-text'
  },
  {
    title: 'Currency',
    path: '/currency',
    icon: <MonetizationOnIcon/>,
    tool: 'Test tool tip',
    //cName: 'nav-text'
  },
  {
    title: 'Logout',
    path: '/logut',
    icon: <MonetizationOnIcon/>,
    tool: 'Test tool tip',
    onclick: {logout},
    //cName: 'nav-text'
  }
];
